import styles from "./ExpenseItem.module.css"

const ExpenseItem = props =>{
    return (
        <div className="nameAgeWrap">
            <div className={styles.name}>{props.name}</div>
            <div>{props.age} years</div>
        </div>
    )
}

export default ExpenseItem;
